import * as d3 from "d3";
import { drawSunburst } from "./sunburstVisualization.js";
import { processData } from "./dataProcessing.js";
import jsonUrl from "./assets/music_genres_full.json";  // 数据路径

async function fetchData() {
  let data;

  try {
    data = await d3.json(jsonUrl);
    console.log("数据加载成功！");
  } catch (error) {
    console.error("数据加载失败:", error);
    return;
  }

  if (!data || !Array.isArray(data)) {
    console.error("数据格式不正确");
    return;
  }

  const cleanedData = processData(data);  // 清洗数据
  drawSunburst(cleanedData);  // 绘制旭日图
}

fetchData();  // 执行数据加载和图表绘制
